import React, { Component }  from 'react';

import { Link } from 'react-router-dom';





class Catalog extends Component{
  constructor(props) {
    super(props);

    this.state = {
      catalog: [['React', ['First Article', 'Second Article']], 
                ['Redux', ['First Article', 'Second Article']]]
    };
  }

  render() {

    return(   
      <div className="catalog">
      <h2> Каталог </h2>
        { 
          this.state.catalog.map( c  =>
            <div key={c} className="catalog_first-level">
              <h3>{c[0]}</h3>
              { 
                c[1].map( k  =>
                  <div key={k} className="catalog_second-level">
                    <h6>{k}</h6>
                  </div>
                )
              }
            </div>
          )
        }

      </div>
    );
  }
}

export default Catalog;
